import React, { useContext } from 'react';
import { globalContext } from './App';
import Navigation from './navigation';

function Profile() {
    const {globalUserObject, setGlobalUserObject} = useContext(globalContext);

    return (
        <div style={{ margin: 'auto', width: 400, border: "1px solid black", padding: 30, paddingTop: 20, borderRadius: 10 }}>
            
            <h1>Profile</h1>
            <p>Your details</p>
            <strong><label>College ID</label></strong>
            <p>{globalUserObject.collegeIdValue}</p>
            <strong><label>Password</label></strong>
            <p>{globalUserObject.passwordValue}</p>
            <strong><label>Email address</label></strong>
            <p>{globalUserObject.emailValue}</p>
            <strong><label>Branch</label></strong>
            <p>{globalUserObject.branchValue}</p>
            <strong><label>Year</label></strong>
            <p>{globalUserObject.yearValue}</p>
            <strong><label>Gender</label></strong>
            <p>{globalUserObject.genderValue}</p>
        </div>
    );
}

export default Profile;
